import React from "react";
import ReactDom from "react-dom";
import logo from "./air_bnb_logo.webp"
import "./style.css"

const App = () =>
{
  const first_name = "shahzaib";
  const last_name = "iqbal";
  return (
    <h1>{first_name} {last_name}</h1>
  )
}
const Element = <>

  <App/>


</>




const root = ReactDom.createRoot(document.getElementById('root'));
root.render(Element);
